59 -22 101 29T43 155Q43 263 172 335L154 348Q133 361 127 368Q70 417 70 494ZM286 386L292 390Q298 394 301 396T311 403T323 413T334 425T345 438T355 454T364 471T369 491T371 513Q371 556 342 586T275 624Q268 625 242 625Q201 625 165 599T128 534Q128 511 141 492T167 463T217 431Q224 426 228 424L286 386ZM250 21Q308 21 350 55T392 137Q392 154 387 169T375 194T353 216T330 234T301 253T274 270Q260 279 244 289T218 306L210 311Q204 311 181 294T133 239T107 157Q107 98 150 60T250 21Z\"></path></g></g></svg></span>, which is the maximum possible.  </p></div></div></div>\r\n            </div>\r\n            \r\n\r\n            \r\n        </div>\r\n\r\n       \r\n        \r\n    </div>\r\n</div>', '3 2<br>\r\n2 3 1<br>\r\n1032<br>\r\n2467<br>\r\n48957', '8\r\n', 1, 'hard', 0, 10, '#include <assert.h>\r\n#include <limits.h>\r\n#include <math.h>\r\n#include <stdbool.h>\r\n#include <stddef.h>\r\n#include <stdint.h>\r\n#include <stdio.h>\r\n#include <stdlib.h>\r\n#include <string.h>\r\n\r\nchar* readline();\r\nchar** split_string(char*);\r\n\r\n// Complete the maximumElegance function below.\r\nint maximumElegance(int q, int s_count, char** s, int b_count, int* b) {\r\n    // Return an integer denoting the maximum elegance which can be obtained by Diane.\r\n\r\n}\r\n\r\nint main()\r\n{\r\n    FILE* fptr = fopen(getenv(\"OUTPUT_PATH\"), \"w\");\r\n\r\n    char** nq = split_string(readline());\r\n\r\n    char* n_endptr;\r\n    char* n_str = nq[0];\r\n    int n = strtol(n_str, &n_endptr, 10);\r\n\r\n    if (n_endptr == n_str || *n_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n    char* q_endptr;\r\n    char* q_str = nq[1];\r\n    int q = strtol(q_str, &q_endptr, 10);\r\n\r\n    if (q_endptr == q_str || *q_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n    char** b_temp = split_string(readline());\r\n\r\n    int* b = malloc(n * sizeof(int));\r\n\r\n    for (int i = 0; i < n; i++) {\r\n        char* b_item_endptr;\r\n        char* b_item_str = *(b_temp + i);\r\n        int b_item = strtol(b_item_str, &b_item_endptr, 10);\r\n\r\n        if (b_item_endptr == b_item_str || *b_item_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n        *(b + i) = b_item;\r\n    }\r\n\r\n    int b_count = n;\r\n\r\n    char** s = malloc(n * sizeof(char*));\r\n\r\n    for (int i = 0; i < n; i++) {\r\n        char* s_item = readline();\r\n\r\n        *(s + i) = s_item;\r\n    }\r\n\r\n    int s_count = n;\r\n\r\n    int result = maximumElegance(q, s_count, s, b_count, b);\r\n\r\n    fprintf(fptr, \"%d\\n\", result);\r\n\r\n    fclose(fptr);\r\n\r\n    return 0;\r\n}\r\n\r\nchar* readline() {\r\n    size_t alloc_length = 1024;\r\n    size_t data_length = 0;\r\n    char* data = malloc(alloc_length);\r\n\r\n    while (true) {\r\n        char* cursor = data + data_length;\r\n        char* line = fgets(cursor, alloc_length - data_length, stdin);\r\n\r\n        if (!line) {\r\n            break;\r\n        }\r\n\r\n        data_length += strlen(cursor);\r\n\r\n        if (data_length < alloc_length - 1 || data[data_length - 1] == \'\\n\') {\r\n            break;\r\n        }\r\n\r\n        alloc_length <<= 1;\r\n\r\n        data = realloc(data, alloc_length);\r\n\r\n        if (!line) {\r\n            break;\r\n        }\r\n    }\r\n\r\n    if (data[data_length - 1] == \'\\n\') {\r\n        data[data_length - 1] = \'\\0\';\r\n\r\n        data = realloc(data, data_length);\r\n    } else {\r\n        data = realloc(data, data_length + 1);\r\n\r\n        data[data_length] = \'\\0\';\r\n    }\r\n\r\n    return data;\r\n}\r\n\r\nchar** split_string(char* str) {\r\n    char** splits = NULL;\r\n    char* token = strtok(str, \" \");\r\n\r\n    int spaces = 0;\r\n\r\n    while (token) {\r\n        splits = realloc(splits, sizeof(char*) * ++spaces);\r\n\r\n        if (!splits) {\r\n            return splits;\r\n        }\r\n\r\n        splits[spaces - 1] = token;\r\n\r\n        token = strtok(NULL, \" \");\r\n    }\r\n\r\n    return splits;\r\n}\r\n', '#include <bits/stdc++.h>\r\n\r\nusing namespace std;\r\n\r\nvector<string> split_string(string);\r\n\r\n// Complete the maximumElegance function below.\r\nint maximumElegance(int q, vector<string> s, vector<int> b) {\r\n    // Return an integer denoting the maximum elegance which can be obtained by Diane.\r\n\r\n}\r\n\r\nint main()\r\n{\r\n    ofstream fout(getenv(\"OUTPUT_PATH\"));\r\n\r\n    string nq_temp;\r\n    getline(cin, nq_temp);\r\n\r\n    vector<string> nq = split_string(nq_temp);\r\n\r\n    int n = stoi(nq[0]);\r\n\r\n    int q = stoi(nq[1]);\r\n\r\n    string b_temp_temp;\r\n    getline(cin, b_temp_temp);\r\n\r\n    vector<string> b_temp = split_string(b_temp_temp);\r\n\r\n    vector<int> b(n);\r\n\r\n    for (int i = 0; i < n; i++) {\r\n        int b_item = stoi(b_temp[i]);\r\n\r\n        b[i] = b_item;\r\n    }\r\n\r\n    vector<string> s(n);\r\n\r\n    for (int i = 0; i < n; i++) {\r\n        string s_item;\r\n        getline(cin, s_item);\r\n\r\n        s[i] = s_item;\r\n    }\r\n\r\n    int result = maximumElegance(q, s, b);\r\n\r\n    fout << result << \"\\n\";\r\n\r\n    fout.close();\r\n\r\n    return 0;\r\n}\r\n\r\nvector<string> split_string(string input_string) {\r\n    string::iterator new_end = unique(input_string.begin(), input_string.end(), [] (const char &x, const char &y) {\r\n        return x == y and x == \' \';\r\n    });\r\n\r\n    input_string.erase(new_end, input_string.end());\r\n\r\n    while (input_string[input_string.length() - 1] == \' \') {\r\n        input_string.pop_back();\r\n    }\r\n\r\n    vector<string> splits;\r\n    char delimiter = \' \';\r\n\r\n    size_t i = 0;\r\n    size_t pos = input_string.find(delimiter);\r\n\r\n    while (pos != string::npos) {\r\n        splits.push_back(input_string.substr(i, pos - i));\r\n\r\n        i = pos + 1;\r\n        pos = input_string.find(delimiter, i);\r\n    }\r\n\r\n    splits.push_back(input_string.substr(i, min(pos, input_string.length()) - i + 1));\r\n\r\n    return splits;\r\n}\r\n', 'import java.io.*;\r\nimport java.math.*;\r\nimport java.security.*;\r\nimport java.text.*;\r\nimport java.util.*;\r\nimport java.util.concurrent.*;\r\nimport java.util.regex.*;\r\n\r\npublic class Solution {\r\n\r\n    // Complete the maximumElegance function below.\r\n    static int maximumElegance(int q, String[] s, int[] b) {\r\n        // Return an integer denoting the maximum elegance which can be obtained by Diane.\r\n\r\n    }\r\n\r\n    private static final Scanner scanner = new Scanner(System.in);\r\n\r\n    public static void main(String[] args) throws IOException {\r\n        BufferedWriter bufferedWriter = new BufferedWriter(new FileWriter(System.getenv(\"OUTPUT_PATH\")));\r\n\r\n        String[] nq = scanner.nextLine().split(\" \");\r\n\r\n        int n = Integer.parseInt(nq[0]);\r\n\r\n        int q = Integer.parseInt(nq[1]);\r\n\r\n        int[] b = new int[n];\r\n\r\n        String[] bItems = scanner.nextLine().split(\" \");\r\n        scanner.skip(\"(\\r\\n|[\\n\\r\\u2028\\u2029\\u0085])?\");\r\n\r\n        for (int i = 0; i < n; i++) {\r\n            int bItem = Integer.parseInt(bItems[i]);\r\n            b[i] = bItem;\r\n        }\r\n\r\n        String[] s = new String[n];\r\n\r\n        for (int i = 0; i < n; i++) {\r\n            String sItem = scanner.nextLine();\r\n            s[i] = sItem;\r\n        }\r\n\r\n        int result = maximumElegance(q, s, b);\r\n\r\n        bufferedWriter.write(String.valueOf(result));\r\n        bufferedWriter.newLine();\r\n\r\n        bufferedWriter.close();\r\n\r\n        scanner.close();\r\n    }\r\n}\r\n');
