 main()\r\n{\r\n    FILE* fptr = fopen(getenv(\"OUTPUT_PATH\"), \"w\");\r\n\r\n    char** nmp = split_string(readline());\r\n\r\n    char* n_endptr;\r\n    char* n_str = nmp[0];\r\n    int n = strtol(n_str, &n_endptr, 10);\r\n\r\n    if (n_endptr == n_str || *n_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n    char* m_endptr;\r\n    char* m_str = nmp[1];\r\n    int m = strtol(m_str, &m_endptr, 10);\r\n\r\n    if (m_endptr == m_str || *m_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n    char* p_endptr;\r\n    char* p_str = nmp[2];\r\n    int p = strtol(p_str, &p_endptr, 10);\r\n\r\n    if (p_endptr == p_str || *p_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n    char** a_temp = split_string(readline());\r\n\r\n    int* a = malloc(n * sizeof(int));\r\n\r\n    for (int i = 0; i < n; i++) {\r\n        char* a_item_endptr;\r\n        char* a_item_str = *(a_temp + i);\r\n        int a_item = strtol(a_item_str, &a_item_endptr, 10);\r\n\r\n        if (a_item_endptr == a_item_str || *a_item_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n        *(a + i) = a_item;\r\n    }\r\n\r\n    int a_count = n;\r\n\r\n    int result_count;\r\n    long* result = xorQueries(a_count, a, m, p, &result_count);\r\n\r\n    for (int i = 0; i < result_count; i++) {\r\n        fprintf(fptr, \"%ld\", *(result + i));\r\n\r\n        if (i != result_count - 1) {\r\n            fprintf(fptr, \"\\n\");\r\n        }\r\n    }\r\n\r\n    fprintf(fptr, \"\\n\");\r\n\r\n    fclose(fptr);\r\n\r\n    return 0;\r\n}\r\n\r\nchar* readline() {\r\n    size_t alloc_length = 1024;\r\n    size_t data_length = 0;\r\n    char* data = malloc(alloc_length);\r\n\r\n    while (true) {\r\n        char* cursor = data + data_length;\r\n        char* line = fgets(cursor, alloc_length - data_length, stdin);\r\n\r\n        if (!line) {\r\n            break;\r\n        }\r\n\r\n        data_length += strlen(cursor);\r\n\r\n        if (data_length < alloc_length - 1 || data[data_length - 1] == \'\\n\') {\r\n            break;\r\n        }\r\n\r\n        alloc_length <<= 1;\r\n\r\n        data = realloc(data, alloc_length);\r\n\r\n        if (!line) {\r\n            break;\r\n        }\r\n    }\r\n\r\n    if (data[data_length - 1] == \'\\n\') {\r\n        data[data_length - 1] = \'\\0\';\r\n\r\n        data = realloc(data, data_length);\r\n    } else {\r\n        data = realloc(data, data_length + 1);\r\n\r\n        data[data_length] = \'\\0\';\r\n    }\r\n\r\n    return data;\r\n}\r\n\r\nchar** split_string(char* str) {\r\n    char** splits = NULL;\r\n    char* token = strtok(str, \" \");\r\n\r\n    int spaces = 0;\r\n\r\n    while (token) {\r\n        splits = realloc(splits, sizeof(char*) * ++spaces);\r\n\r\n        if (!splits) {\r\n            return splits;\r\n        }\r\n\r\n        splits[spaces - 1] = token;\r\n\r\n        token = strtok(NULL, \" \");\r\n    }\r\n\r\n    return splits;\r\n}\r\n', '#include <bits/stdc++.h>\r\n\r\nusing namespace std;\r\n\r\nvector<string> split_string(string);\r\n\r\n// Complete the xorQueries function below.\r\nvector<long> xorQueries(vector<int> a, int m, int p) {\r\n    // Return an array consisting of the answers of all type-2 queries.\r\n\r\n}\r\n\r\nint main()\r\n{\r\n    ofstream fout(getenv(\"OUTPUT_PATH\"));\r\n\r\n    string nmp_temp;\r\n    getline(cin, nmp_temp);\r\n\r\n    vector<string> nmp = split_string(nmp_temp);\r\n\r\n    int n = stoi(nmp[0]);\r\n\r\n    int m = stoi(nmp[1]);\r\n\r\n    int p = stoi(nmp[2]);\r\n\r\n    string a_temp_temp;\r\n    getline(cin, a_temp_temp);\r\n\r\n    vector<string> a_temp = split_string(a_temp_temp);\r\n\r\n    vector<int> a(n);\r\n\r\n    for (int i = 0; i < n; i++) {\r\n        int a_item = stoi(a_temp[i]);\r\n\r\n        a[i] = a_item;\r\n    }\r\n\r\n    vector<long> result = xorQueries(a, m, p);\r\n\r\n    for (int i = 0; i < result.size(); i++) {\r\n        fout << result[i];\r\n\r\n        if (i != result.size() - 1) {\r\n            fout << \"\\n\";\r\n        }\r\n    }\r\n\r\n    fout << \"\\n\";\r\n\r\n    fout.close();\r\n\r\n    return 0;\r\n}\r\n\r\nvector<string> split_string(string input_string) {\r\n    string::iterator new_end = unique(input_string.begin(), input_string.end(), [] (const char &x, const char &y) {\r\n        return x == y and x == \' \';\r\n    });\r\n\r\n    input_string.erase(new_end, input_string.end());\r\n\r\n    while (input_string[input_string.length() - 1] == \' \') {\r\n        input_string.pop_back();\r\n    }\r\n\r\n    vector<string> splits;\r\n    char delimiter = \' \';\r\n\r\n    size_t i = 0;\r\n    size_t pos = input_string.find(delimiter);\r\n\r\n    while (pos != string::npos) {\r\n        splits.push_back(input_string.substr(i, pos - i));\r\n\r\n        i = pos + 1;\r\n        pos = input_string.find(delimiter, i);\r\n    }\r\n\r\n    splits.push_back(input_string.substr(i, min(pos, input_string.length()) - i + 1));\r\n\r\n    return splits;\r\n}\r\n', 'import java.io.*;\r\nimport java.math.*;\r\nimport java.security.*;\r\nimport java.text.*;\r\nimport java.util.*;\r\nimport java.util.concurrent.*;\r\nimport java.util.regex.*;\r\n\r\npublic class Solution {\r\n\r\n    // Complete the xorQueries function below.\r\n    static long[] xorQueries(int[] a, int m, int p) {\r\n        // Return an array consisting of the answers of all type-2 queries.\r\n\r\n    }\r\n\r\n    private static final Scanner scanner = new Scanner(System.in);\r\n\r\n    public static void main(String[] args) throws IOException {\r\n        BufferedWriter bufferedWriter = new BufferedWriter(new FileWriter(System.getenv(\"OUTPUT_PATH\")));\r\n\r\n        String[] nmp = scanner.nextLine().split(\" \");\r\n\r\n        int n = Integer.parseInt(nmp[0]);\r\n\r\n        int m = Integer.parseInt(nmp[1]);\r\n\r\n        int p = Integer.parseInt(nmp[2]);\r\n\r\n        int[] a = new int[n];\r\n\r\n        String[] aItems = scanner.nextLine().split(\" \");\r\n        scanner.skip(\"(\\r\\n|[\\n\\r\\u2028\\u2029\\u0085])?\");\r\n\r\n        for (int i = 0; i < n; i++) {\r\n            int aItem = Integer.parseInt(aItems[i]);\r\n            a[i] = aItem;\r\n        }\r\n\r\n        long[] result = xorQueries(a, m, p);\r\n\r\n        for (int i = 0; i < result.length; i++) {\r\n            bufferedWriter.write(String.valueOf(result[i]));\r\n\r\n            if (i != result.length - 1) {\r\n                bufferedWriter.write(\"\\n\");\r\n            }\r\n        }\r\n\r\n        bufferedWriter.newLine();\r\n\r\n        bufferedWriter.close();\r\n\r\n        scanner.close();\r\n    }\r\n}\r\n');
