r;\r\n    char* q_str = readline();\r\n    int q = strtol(q_str, &q_endptr, 10);\r\n\r\n    if (q_endptr == q_str || *q_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n    for (int q_itr = 0; q_itr < q; q_itr++) {\r\n        char** h1M1H2M2 = split_string(readline());\r\n\r\n        char* h1_endptr;\r\n        char* h1_str = h1M1H2M2[0];\r\n        int h1 = strtol(h1_str, &h1_endptr, 10);\r\n\r\n        if (h1_endptr == h1_str || *h1_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n        char* m1_endptr;\r\n        char* m1_str = h1M1H2M2[1];\r\n        int m1 = strtol(m1_str, &m1_endptr, 10);\r\n\r\n        if (m1_endptr == m1_str || *m1_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n        char* h2_endptr;\r\n        char* h2_str = h1M1H2M2[2];\r\n        int h2 = strtol(h2_str, &h2_endptr, 10);\r\n\r\n        if (h2_endptr == h2_str || *h2_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n        char* m2_endptr;\r\n        char* m2_str = h1M1H2M2[3];\r\n        int m2 = strtol(m2_str, &m2_endptr, 10);\r\n\r\n        if (m2_endptr == m2_str || *m2_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n        char* k_endptr;\r\n        char* k_str = readline();\r\n        int k = strtol(k_str, &k_endptr, 10);\r\n\r\n        if (k_endptr == k_str || *k_endptr != \'\\0\') { exit(EXIT_FAILURE); }\r\n\r\n        int result = lagDuration(h1, m1, h2, m2, k);\r\n\r\n        fprintf(fptr, \"%d\\n\", result);\r\n    }\r\n\r\n    fclose(fptr);\r\n\r\n    return 0;\r\n}\r\n\r\nchar* readline() {\r\n    size_t alloc_length = 1024;\r\n    size_t data_length = 0;\r\n    char* data = malloc(alloc_length);\r\n\r\n    while (true) {\r\n        char* cursor = data + data_length;\r\n        char* line = fgets(cursor, alloc_length - data_length, stdin);\r\n\r\n        if (!line) {\r\n            break;\r\n        }\r\n\r\n        data_length += strlen(cursor);\r\n\r\n        if (data_length < alloc_length - 1 || data[data_length - 1] == \'\\n\') {\r\n            break;\r\n        }\r\n\r\n        alloc_length <<= 1;\r\n\r\n        data = realloc(data, alloc_length);\r\n\r\n        if (!line) {\r\n            break;\r\n        }\r\n    }\r\n\r\n    if (data[data_length - 1] == \'\\n\') {\r\n        data[data_length - 1] = \'\\0\';\r\n\r\n        data = realloc(data, data_length);\r\n    } else {\r\n        data = realloc(data, data_length + 1);\r\n\r\n        data[data_length] = \'\\0\';\r\n    }\r\n\r\n    return data;\r\n}\r\n\r\nchar** split_string(char* str) {\r\n    char** splits = NULL;\r\n    char* token = strtok(str, \" \");\r\n\r\n    int spaces = 0;\r\n\r\n    while (token) {\r\n        splits = realloc(splits, sizeof(char*) * ++spaces);\r\n\r\n        if (!splits) {\r\n            return splits;\r\n        }\r\n\r\n        splits[spaces - 1] = token;\r\n\r\n        token = strtok(NULL, \" \");\r\n    }\r\n\r\n    return splits;\r\n}\r\n', '#include <bits/stdc++.h>\r\n\r\nusing namespace std;\r\n\r\nvector<string> split_string(string);\r\n\r\n// Complete the lagDuration function below.\r\nint lagDuration(int h1, int m1, int h2, int m2, int k) {\r\n    // Return an integer denoting the duration of time in minutes by which the clock has been lagging.\r\n\r\n}\r\n\r\nint main()\r\n{\r\n    ofstream fout(getenv(\"OUTPUT_PATH\"));\r\n\r\n    int q;\r\n    cin >> q;\r\n    cin.ignore(numeric_limits<streamsize>::max(), \'\\n\');\r\n\r\n    for (int q_itr = 0; q_itr < q; q_itr++) {\r\n        string h1M1H2M2_temp;\r\n        getline(cin, h1M1H2M2_temp);\r\n\r\n        vector<string> h1M1H2M2 = split_string(h1M1H2M2_temp);\r\n\r\n        int h1 = stoi(h1M1H2M2[0]);\r\n\r\n        int m1 = stoi(h1M1H2M2[1]);\r\n\r\n        int h2 = stoi(h1M1H2M2[2]);\r\n\r\n        int m2 = stoi(h1M1H2M2[3]);\r\n\r\n        int k;\r\n        cin >> k;\r\n        cin.ignore(numeric_limits<streamsize>::max(), \'\\n\');\r\n\r\n        int result = lagDuration(h1, m1, h2, m2, k);\r\n\r\n        fout << result << \"\\n\";\r\n    }\r\n\r\n    fout.close();\r\n\r\n    return 0;\r\n}\r\n\r\nvector<string> split_string(string input_string) {\r\n    string::iterator new_end = unique(input_string.begin(), input_string.end(), [] (const char &x, const char &y) {\r\n        return x == y and x == \' \';\r\n    });\r\n\r\n    input_string.erase(new_end, input_string.end());\r\n\r\n    while (input_string[input_string.length() - 1] == \' \') {\r\n        input_string.pop_back();\r\n    }\r\n\r\n    vector<string> splits;\r\n    char delimiter = \' \';\r\n\r\n    size_t i = 0;\r\n    size_t pos = input_string.find(delimiter);\r\n\r\n    while (pos != string::npos) {\r\n        splits.push_back(input_string.substr(i, pos - i));\r\n\r\n        i = pos + 1;\r\n        pos = input_string.find(delimiter, i);\r\n    }\r\n\r\n    splits.push_back(input_string.substr(i, min(pos, input_string.length()) - i + 1));\r\n\r\n    return splits;\r\n}\r\n', 'import java.io.*;\r\nimport java.math.*;\r\nimport java.security.*;\r\nimport java.text.*;\r\nimport java.util.*;\r\nimport java.util.concurrent.*;\r\nimport java.util.regex.*;\r\n\r\npublic class Solution {\r\n\r\n    // Complete the lagDuration function below.\r\n    static int lagDuration(int h1, int m1, int h2, int m2, int k) {\r\n        // Return an integer denoting the duration of time in minutes by which the clock has been lagging.\r\n\r\n    }\r\n\r\n    private static final Scanner scanner = new Scanner(System.in);\r\n\r\n    public static void main(String[] args) throws IOException {\r\n        BufferedWriter bufferedWriter = new BufferedWriter(new FileWriter(System.getenv(\"OUTPUT_PATH\")));\r\n\r\n        int q = scanner.nextInt();\r\n        scanner.skip(\"(\\r\\n|[\\n\\r\\u2028\\u2029\\u0085])?\");\r\n\r\n        for (int qItr = 0; qItr < q; qItr++) {\r\n            String[] h1M1H2M2 = scanner.nextLine().split(\" \");\r\n\r\n            int h1 = Integer.parseInt(h1M1H2M2[0]);\r\n\r\n            int m1 = Integer.parseInt(h1M1H2M2[1]);\r\n\r\n            int h2 = Integer.parseInt(h1M1H2M2[2]);\r\n\r\n            int m2 = Integer.parseInt(h1M1H2M2[3]);\r\n\r\n            int k = scanner.nextInt();\r\n            scanner.skip(\"(\\r\\n|[\\n\\r\\u2028\\u2029\\u0085])?\");\r\n\r\n            int result = lagDuration(h1, m1, h2, m2, k);\r\n\r\n            bufferedWriter.write(String.valueOf(result));\r\n            bufferedWriter.newLine();\r\n        }\r\n\r\n        bufferedWriter.close();\r\n\r\n        scanner.close();\r\n    }\r\n}\r\n');
