(5, 'Exam Rush', '<div class=\"container fs-container\">\r\n    <div class=\"row\">\r\n        <div class=\"span-sm-11 hr_tour-problem-statement problem-statement\">\r\n            \r\n            \r\n            \r\n            \r\n            <div class=\"content-text challenge-text mlB\">\r\n                <div class=\"challenge_problem_statement\"><div class=\"msB challenge_problem_statement_body\"><div class=\"hackdown-content\"><style id=\"MathJax_SVG_styles\">.MathJax_SVG_Display {text-align: center; margin: 1em 0em; position: relative; display: block!important; text-indent: 0; max-width: none; max-height: none; min-width: 0; min-height: 0; width: 100%}\r\n.MathJax_SVG .MJX-monospace {font-family: monospace}\r\n.MathJax_SVG .MJX-sans-serif {font-family: sans-serif}\r\n.MathJax_SVG {display: inline; font-style: normal; font-weight: normal; line-height: normal; font-size: 100%; font-size-adjust: none; text-indent: 0; text-align: left; text-transform: none; letter-spacing: normal; word-spacing: normal; word-wrap: normal; white-space: nowrap; float: none; direction: ltr; max-width: none; max-height: none; min-width: 0; min-height: 0; border: 0; padding: 0; margin: 0}\r\n.MathJax_SVG * {transition: none; -webkit-transition: none; -moz-transition: none; -ms-transition: none; -o-transition: none}\r\n.mjx-svg-href {fill: blue; stroke: blue}\r\n.MathJax_SVG_LineBox {display: table!important}\r\n.MathJax_SVG_LineBox span {display: table-cell!important; width: 10000em!important; min-width: 0; max-width: none; padding: 0; border: 0; margin: 0}\r\n</style><svg style=\"display: none;\"><defs id=\"MathJax_SVG_glyphs\"></defs></svg><p>Your final exam is approaching and you haven\'t begun to study.  In order to have the best chance of passing the course, you resolve to study from now until exam time.  Chapters vary in length, but not in value towards a passing grade, so you want to study as many complete chapters as possible.  The order of chapters doesn\'t matter, but you must complete a chapter before it will help your grade.</p>\r\n\r\n<p>Your task is to maximize the number of complete chapters you can study between now and exam time.  </p>\r\n\r\n<p>Complete the function <em>examRush</em> to return the integer value representing the maximum number of chapters you can study before the exam.</p></div></div></div><div class=\"challenge_input_format\"><div class=\"msB challenge_input_format_title\"><p><strong>Input Format</strong></p></div><div class=\"msB challenge_input_format_body\"><div class=\"hackdown-content\"><style id=\"MathJax_SVG_styles\">.MathJax_SVG_Display {text-align: center; margin: 1em 0em; position: relative; display: block!important; text-indent: 0; max-width: none; max-height: none; min-width: 0; min-height: 0; width: 100%}\r\n.MathJax_SVG .MJX-monospace {font-family: monospace}\r\n.MathJax_SVG .MJX-sans-serif {font-family: sans-serif}\r\n.MathJax_SVG {display: inline; font-style: normal; font-weight: normal; line-height: normal; font-size: 100%; font-size-adjust: none; text-indent: 0; text-align: left; text-transform: none; letter-spacing: normal; word-spacing: normal; word-wrap: normal; white-space: nowrap; float: none; direction: ltr; max-width: none; max-height: none; min-width: 0; min-height: 0; border: 0; padding: 0; margin: 0}\r\n.MathJax_SVG * {transition: none; -webkit-transition: none; -moz-transition: none; -ms-transition: none; -o-transition: none}\r\n.mjx-svg-href {fill: blue; stroke: blue}\r\n.MathJax_SVG_LineBox {display: table!important}\r\n.MathJax_SVG_LineBox span {display: table-cell!important; width: 10000em!important; min-width: 0; max-width: none; padding: 0; border: 0; margin: 0}\r\n</style><svg style=\"display: none;\"><defs id=\"MathJax_SVG_glyphs\"></defs></svg><p>The first line contains an integer number, <span style=\"font-size: 100%; display: inline-block;\" class=\"MathJax_SVG\" id=\"MathJax-Element-1-Frame\"><svg xmlns:xlink=\"http://www.w3.org/1999/xlink\" width=\"1.395ex\" height=\"1